{
  "openapi": "3.0.0",
  "info": {
    "title": "Nexus API",
    "description": "Nexus API Endpoints",
    "contact": {
      "name": "LEAF Support",
      "email": "leafsupport@ablevets.com"
    },
    "license": {
      "name": "Apache 2.0",
      "url": "https://www.apache.org/licenses/LICENSE-2.0.html"
    },
    "version": "2.0.0"
  },
  "servers": [
    {
      "url": "https://localhost/LEAF_Nexus/api/",
      "description": "Local DEV server (uses test data)"
    }
  ],
  "components": {
    "schemas": {
      "employees": {
        "description": "List of employee",
        "type": "array",
        "items": {
          "$ref": "#/components/schemas/employee"
        }
      },
      "employee": {
        "description": "Model of employee",
        "type": "object",
        "properties": {
          "firstName": {
            "type": "string"
          },
          "lastName": {
            "type": "string"
          },
          "middleName": {
            "type": "string"
          },
          "userName": {
            "type": "string"
          }
        },
        "example": {
          "firstName": "Lilly",
          "lastName": "Wang",
          "middleName": null,
          "userName": "lillyw"
        }
      },
      "groups": {
        "description": "Model of group",
        "type": "object",
        "properties": {
          "groupTitle": {
            "type": "string"
          },
          "parentID": {
            "type": "integer"
          }
        },
        "example": {
          "groupTitle": "LWTesting",
          "parentID": 0
        }
      },
      "positions": {
        "description": "Model of positions",
        "type": "object",
        "properties": {
          "positionTitle": {
            "type": "string"
          },
          "parentID": {
            "type": "integer"
          },
          "positionID": {
            "type": "integer"
          }
        },
        "example": {
          "positionTitle": "Test Position Title Super",
          "parentID": 0,
          "positionID": 2
        }
      }
    },
    "responses": {
      "404NotFound": {
        "description": "The specified resource was not found."
      },
      "400InvalidID": {
        "description": "The specified resource was invalid."
      },
      "default": {
        "description": "Unexpected error"
      }
    },
    "parameters": {
      "cookieParam": {
        "name": "cookie",
        "in": "header",
        "description": "PHPSESSID to be passed as a header",
        "required": true,
        "schema": {
          "type": "string"
        }
      },
      "tokenParam": {
        "name": "CSRFToken",
        "in": "header",
        "description": "CSRFToken to be passed as a header",
        "required": true,
        "schema": {
          "type": "string"
        }
      }
    }
  },
  "paths": {
    "/": {
      "get": {
        "summary": "Give an API endpoint as query parameter for GET operation",
        "parameters": [
          {
            "in": "query",
            "name": "a",
            "required": true,
            "schema": {
              "type": "string",
              "example": "employee/1",
              "enum": [
                "employee/1",
                "group/list",
                "position/90"
              ]
            },
            "allowReserved": true
          }
        ],
        "responses": {
          "200": {
            "description": "Successful operation"
          }
        }
      },
      "post": {
        "summary": "Give an API endpoint as query parameter for POST operation",
        "parameters": [
          {
            "$ref": "#/components/parameters/cookieParam"
          },
          {
            "$ref": "#/components/parameters/tokenParam"
          },
          {
            "in": "query",
            "name": "a",
            "required": true,
            "schema": {
              "type": "string"
            },
            "allowReserved": true,
            "example": "employee/new"
          }
        ],
        "requestBody": {
          "description": "Provide a requestBody content for the endpoint.",
          "required": true,
          "content": {
            "application/json": {
              "schema": {
                "type": "object"
              },
              "example": {
                "firstName": "Lilly",
                "lastName": "Wang",
                "middleName": null,
                "userName": "lillyw"
              }
            },
            "application/xml": {
              "schema": {
                "type": "object"
              },
              "example": {
                "firstName": "Lilly",
                "lastName": "Wang",
                "middleName": null,
                "userName": "lillyw"
              }
            }
          }
        },
        "responses": {
          "200": {
            "description": "Successful operation"
          }
        }
      },
      "delete": {
